import './App.css';
import DisplayHeader from './components/atm-header';
import DisplayScreen from './components/atm-screen';
import { createTheme, Box, Grid2, Grid } from '@mui/material';
import { makeStyles } from 'tss-react/mui';

const useStyles = makeStyles()((theme) => ({
  button: {
    backgroundColor: theme.palette.primary.main,
    color: theme.palette.primary.contrastText,
    // '&:hover': {
    //   backgroundColor: theme.palette.primary.dark,
    // },
  },
}));

function App() {
  const { classes } = useStyles();

  return (
    <Grid2 container direction="column" classes={classes.container}>
      <Grid2 item>
        <DisplayHeader />
      </Grid2>
      <Grid2 item>
        <DisplayScreen />
      </Grid2>
    </Grid2>
  );
}

export default App;
